B.qa=new A.bk([B.tk,"Bem-vindo ao meu site! Fiz ele para me apresentar, ent\xe3o achei que seria legal fazer isso mostrando os c\xf4modos de onde moro. Para continuar a conversa, clique neste bal\xe3o de mensagem.",B.tu,".... Eu n\xe3o moro aqui de verdade \ud83d\ude05. S\xe3o imagens que peguei na internet. Elas usam a licen\xe7a CC0 e n\xe3o tem direito autoral. S\xe3o meramente ilustrativas.",B.tv,"Essa \xe9 a porta de entrada... Para entrar, experimente clicar na ma\xe7aneta (S\xf3 funciona depois de clicar neste bal\xe3o e acabar a conversa). Voc\xea tamb\xe9m pode me perguntar alguma das op\xe7\xf5es do canto inferior esquerdo da tela. Se sua tela for estreita, as setas no canto inferior direito ajudam a olhar o resto da imagem.",B.tw,"Olha! Parece que tinha uma chave escondida aqui! Aposto que agora podemos abrir a porta!",B.ty,"A porta est\xe1 trancada. Acho que j\xe1 era de se esperar, n\xe9? Ou voc\xea por um acaso sai por a\xed deixando sua porta aberta? Por\xe9m eu n\xe3o consigo achar a chave em nenhum lugar...",B.tz,"Agora sim! Com a chave podemos entrar. Venha... vou te mostrar os aposentos.",B.tx,"A gente j\xe1 conseguiu a chave. Agora sim podemos clicar na ma\xe7aneta para entrar.",B.tA,"Lar doce lar! Daqui podemos subir as escadas, onde temos os quartos e o banheiro. Ou, podemos ficar no primeiro andar mesmo e conhecer a sala e a cozinha. Tamb\xe9m podemos voltar e sair, se quiser.",B.tB,"Vamos subindo, cuidado para n\xe3o trope\xe7ar.",B.tl,"Sei que est\xe1 de dia, mas n\xe3o \xe9 seguro subir com as luzes apagadas.",B.tm,"Ent\xe3o vamos conhecer o resto do primeiro andar...",B.jA,"S\xe3o",B.tn,"Eu acho, n\xe9. Se o rel\xf3gio do seu dispositivo estiver errado, posso ter me enganado. Por\xe9m, n\xe3o faz diferen\xe7a. A foto daqui s\xf3 foi tirada de dia mesmo.",B.to,"\xd3timo, com as luzes acesas, podemos subir as escadas.",B.tp,"Voc\xea apagou as luzes de novo.",B.tq,"Aqui \xe9 a sala de estar. Daqui podemos voltar ao corredor de entrada e tamb\xe9m podemos subir as escadas. Temos uma cozinha como anexo e podemos sentar para assistir algo na televis\xe3o.",B.tr,"Vamos ver o qu\xea est\xe1 passando na TV. Ah sim... uma gameplay de um jogo muito conhecido: Tile Paths!",B.ts,"Estamos no topo da escada. Podemos descer novamente ou olhar o segundo andar.",B.tt,"Aqui \xe9 o segundo andar. As portas d\xe3o acesso ao banheiro, ao meu quarto e ao escrit\xf3rio."],A.S("bk<ca,q>"))
